const Add = () => {
  const [book,setBooks]= useState ({
    title: "",
    desc: "",
    price
  })
  return (
    <div className="form">
      <h1>Add New Book</h1>
      <input type="text" placeholder='title' />
      <input type="text" placeholder='desc' />
      <input type="number" placeholder='price' />
      <input type="text" placeholder='cover' />
    </div>
  )
}

export default Add
